import React from 'react';

import style from './homepage.module.scss';
import { getClassName } from '../../utils/component-utils';

export default function HomePage() {
    return (
        <div className="bgimg container animate-opacity text-white">
            <div className="banner-display-middle">
                <h1 className="welcome-weight welcome-jumbo welcome-animate-top content-center">
                    Welcome to <br/> Watering System
                </h1>
                <hr className="border-grey border-size border-animation"/>
                <p className="content-large content-center">
                    The Website will assist you in irrigating your plants easily with our features.
                    <br/> Let's sign in and try to use these features.
                </p>
                <a href="#" className="button-font-size button-sign-in button-center">Sign In</a>
            </div>
        </div>
    );
}
